import React, { Component } from "react";
import "./App.css";
import { Container, Badge } from "reactstrap";
import { Router } from "react-router-dom";
export class App extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about">About</Link>
              </li>
              <li>
                <Link to="/users">Users</Link>
              </li>
            </ul>
          </nav>
        </div>
      </Router>
    );
  }
}

export default App;

